Promotional info from ComicVine - &quot;Chloe Noonan is a monster hunter, but she doesn't have any powers. She can't beat up bad guys, she can't run without getting a stitch. She's kinda flakey and really not bothered about saving the world. Especially when she has to get the bus everywhere. Set in the fictional British town of Ravensdale, this ongoing series of comics and short stories sees our eponymous hero Chloe Noonan team up with a government led squad of Monster Hunters to solve the ever growing monster problem. This digital omnibus collects every Chloe Noonan story to date in full colour and comes complete with a cover illustration gallery, fan art section and a look into creator Marc (Ellerbisms, Love The Way You Love) Ellerby's sketchbook designs.&quot;

This is the digital copy by Minutemen-InnerDemons. Please seed and enjoy! :-)

